A connection to a multiplexer made via a unix socket is referred to as a unix domain . Unix domains are supported on all systems, even Windows and are a way to connect the native win32 GUI into the Windows Subsystem for Linux (WSL). The bare minimum configuration to enable a unix domain is this, which will spawn a server if needed and then connect the gui to it automatically when wezterm is launched: return { unix_domains = { { name = "unix", connect_automatically = true, } }
} If you prefer to connect manually, omit the connect_automatically setting (or set it to false) and then run: $ wezterm connect unix The possible configuration values are: return { unix_domains = { { name = "unix", -- If true, connect to this unix domain when `wezterm` is started connect_automatically = true, -- The path to the socket. If unspecified, a resonable default -- value will be computed. -- socket_path = "/some/path", -- If true, do not attempt to start this server if we try and fail to -- connect to it. -- no_serve_automatically = false, -- If true, bypass checking for secure ownership of the -- socket_path. This is not recommended on a multi-user -- system, but is useful for example when running the -- server inside a WSL container but with the socket -- on the host NTFS volume. -- skip_permissions_check = false, } }
}

